import React, { Component } from 'react';
import PropTypes from 'prop-types';

class VideoItem extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    const { video } = this.props;
    return <div>V{video.snippet.title}</div>;
  }
}

VideoItem.propTypes = {
  video: PropTypes.instanceOf(PropTypes.object).isRequired,
};

export default VideoItem;
